import { useDispatch, useSelector } from 'react-redux';
import { Route, Routes } from 'react-router-dom';
import './App.scss';
import LogIn from './Components/LogIn/LogIn';
import NavBar from './Components/NavBar/NavBar';







function App() {

  return (

  <>
    <NavBar />
    <Routes>
      <Route path='/' element={<LogIn />} />
    </Routes>
  </>
  );
}

export default App;
